import { Player, ControlBar } from 'video-react';

const Elaborate = () => {
return (
    <Player src="http://media.w3.org/2010/05/bunny/movie.mp4" autoPlay>
    <ControlBar autoHide={false}>
    
    </ControlBar>
  </Player>
 )
};

export default Elaborate;
